  const obj = {
    id: 1,
    title : 'JS full tutorial',
    channelName: 'rocky hasan',
    isVerified: true,
    view : '100k',
    time: '1 month ago',
  }

  return (
    <div className='container'>
      {data.map(video => {
        <Video
        id={video.id}
        ></Video>
      })}
    </div>
  );
}

export default App;
